import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Settings = () => {
  const [profile, setProfile] = useState({ fullName: '', email: '', password: '' });
  const [message, setMessage] = useState('');

  // Fetch current user profile on load
  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get('/api/doctor/profile', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setProfile({ fullName: response.data.fullName, email: response.data.email, password: '' });
      } catch (error) {
        console.error(error);
      }
    };

    fetchProfile();
  }, []);

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem('token');
      const response = await axios.put(
        '/api/doctor/update-profile',
        { ...profile },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setMessage(response.data.msg); // Show success message
    } catch (error) {
      console.error(error);
      setMessage(error.response?.data?.msg || 'Error updating profile.');
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Update Profile</h2>
      {message && <p>{message}</p>}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Full Name:</label>
          <input
            type="text"
            value={profile.fullName}
            onChange={(e) => setProfile({ ...profile, fullName: e.target.value })}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            value={profile.email}
            onChange={(e) => setProfile({ ...profile, email: e.target.value })}
            required
          />
        </div>
        <div>
          <label>Password (Optional):</label>
          <input
            type="password"
            value={profile.password}
            onChange={(e) => setProfile({ ...profile, password: e.target.value })}
          />
        </div>
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
};

export default Settings;
